  namespace: NDSH.Geospatial.Common.BasicTypes.Implementation.Names
  summary: Represents a fully qualified, hierarchical name within a namespace, as defined in ISO 19103.
  remarks: >-
    <p>
      A <xref href="NDSH.Geospatial.Common.BasicTypes.Implementation.Names.ScopedName" data-throw-if-not-resolved="false"></xref> consists of a namespace (scope) and a local name.
      It provides a structured naming mechanism that allows metadata elements to be referenced
      in a hierarchical manner, supporting interoperability in geospatial metadata.
    </p>

    <p>
      <xref href="NDSH.Geospatial.Gml.BasicTypes.CodeType.CodeSpace?text=CodeSpace" data-throw-if-not-resolved="false"></xref> can have values from the following <b>three</b> categories:
      <ul><li>
          A simple name (e.g., a dictionary name, authority, or classification scheme).
        </li><li>
          A hierarchical namespace (it can be a dot . pattern, similar to programming namespaces).
        </li><li>
          A URI (Uniform Resource Identifier) (commonly used for globally unique references).
        </li></ul>
    </p>

    <p>
      <b><i>EXAMPLES:</i></b>
      <ol><li>
          <b>Simple Name</b>
          <ul><li><span class="term">"ISO19115"</span>A metadata standard name</li><li><span class="term">"EPSG"</span>A spatial reference system authority</li><li><span class="term">"OGC"</span>Open Geospatial Consortium</li></ul>
        </li><li>
          <b>Dot (.) Namespace Pattern</b>
          <ul><li><span class="term">"Geospatial.Metadata"</span>A structured namespace in a system</li><li><span class="term">"Physical.Geology"</span>A hierarchical category in a geoscience dataset</li><li><span class="term">"ISO.Geospatial.Metadata"</span>A structured ISO metadata namespace</li></ul>
        </li><li>
          <b>URI (Web-based Reference)</b>
          <ul><li><span class="term">"https://www.opengis.net/def/namespaces"</span>A persistent web reference to a geospatial definition</li><li><span class="term">"http://metadata.iso.org/19115"</span>A direct reference to ISO 19115 metadata</li><li><span class="term">"http://www.epsg-registry.org/"</span>The EPSG coordinate reference system registry</li></ul>
        </li><li>
          <b>URN (Uniform Resource Name)</b>
          <ul><li><span class="term">"urn:ogc:def:crs:EPSG::4326"</span>A structured identifier for an EPSG coordinate system</li><li><span class="term">"urn:x-ogc:def:metadata:ISO19115:2003"</span>A URN reference to ISO 19115 metadata</li></ul>
        </li><li>
          <b>UUID-based Identifier</b>
            <ul><li><span class="term">"urn:uuid:123e4567-e89b-12d3-a456-426614174000"</span>A globally unique identifier for a metadata record</li></ul>
        </li></ol>
    </p>
